		  #n-loadingNotification {
			display: flex;
			align-content: center;
			flex-direction: column;
			height: 50vh;
			justify-content: center;

				transform: rotateZ(0deg);
			}
			100% {
				transform: rotateZ(360deg);
			}
		  }
		  @keyframes fade {
			0% {

			transform: scale(1.2);
			opacity: 0;
			}

				-webkit-transform: scale(1);
				transform: scale(1);
				opacity: 1;
			}

				transform: scale(1);
				opacity: 1;
			}
